import networkit as nk
import simexpal
import osmnx
import networkx as nx
import folium
import pandas as pd

def loadGraph(run: simexpal.base.Run):
    """ Load the networkit graph of a simexpal run """
    return loadGraphFromPath(run.instance.fullpath)

def loadGraphFromPath(path: str):
    """ Load the networkit graph for given path """
    graph = nk.readGraph(path)
    # state = graph.attachEdgeAttribute("state", float)
    # state.read(run.instance.fullpath[:-4] + '.state')
    # cost = graph.attachEdgeAttribute("cost", float)
    wayids = graph.attachEdgeAttribute("wayids", str)
    wayids.read(path[:-4] + '.wayids')
    u = graph.attachEdgeAttribute("sourceid", str)
    u.read(path[:-4] + '.sourceid')
    v = graph.attachEdgeAttribute("destid", str)
    v.read(path[:-4] + '.destid')
    return graph, u, v, wayids

def load_gdf(location: str):
    """ Load the gdf of a location string """
    # keep smoothness property of the road (osm tag)
    osmnx.settings.useful_tags_way = osmnx.settings.useful_tags_way + ["smoothness"]
    # download location with OSMnx
    G = osmnx.graph_from_place(
        location,
        network_type="drive",
        custom_filter='["highway"]["highway"!~"footway|bridleway|path|service|track|steps"]',
    )
    G.remove_edges_from(nx.selfloop_edges(G))
    return osmnx.graph_to_gdfs(G, nodes=False, edges=True)

def create_coords(source, target, gdf):
    query_res = gdf.query(f'u == {source} and v == {target}').geometry
    coords = []
    for entry in query_res:
        coords.extend([(y,x) for x,y in entry.coords])
    return coords

def map_results(row: pd.Series, print_overview: bool = True, color="#FF0000", map_location=[52,13], zoom=15):
    """ Draw the results of a run on the map """
    assert(len(row) == 1)
    split = row.instance.values[0].split('-')
    if len(split) > 3:
        # first part is name that includes - which we need to keep
        city = '-'.join(split[:-2])
        location = f'{city}, {split[-2]}, {split[-1]}'
    else:
        location = ', '.join(split)
    gdf = load_gdf(location)
    g, sourceids, destids, wayids = loadGraph(row.run.values[0])
    if print_overview: nk.overview(g)
    coords = []
    for edge in row.edges.values[0]:
        edgeid = g.edgeId(*edge)
        edge_coords = create_coords(sourceids[edgeid], destids[edgeid], gdf)
        if len(edge_coords) == 0:
            print('no coords for edge', edge, 'wayid:', wayids[edge])
        else:
            coords.append(edge_coords)

    tiles = 'https://{s}.basemaps.cartocdn.com/rastertiles/voyager_nolabels/{z}/{x}/{y}{r}.png'
    attr = (
        '&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a>',
        'contributors &copy; <a href="https://carto.com/attributions">CARTO</a>',
    )

    m = folium.Map(location=map_location, zoom_start=zoom, tiles=tiles, attr=attr)

    folium.PolyLine(locations=coords, color=color, weight=6).add_to(m)
    return m

def map_graph(row, highlightPairs = ()):
    """ Draw the graph of a run on the map. Optionally highlight some edges (osm node id pairs) """
    assert(len(row) == 1)
    split = row.instance.values[0].split('-')
    if len(split) > 3:
        # first part is name that includes - which we need to keep
        city = '-'.join(split[:-2])
        location = f'{city}, {split[-2]}, {split[-1]}'
    else:
        location = ', '.join(split)
    gdf = load_gdf(location)
    g, sourceids, destids, wayids = loadGraph(row.run.values[0])
    m = folium.Map(location=[52.4978, 13.4507], zoom_start=12)
    for edge in g.iterEdges():
        edge_line = create_coords(sourceids[edge], destids[edge], gdf)
        if len(edge_line) == 0:
            continue
                
        if (int(sourceids[edge]), int(destids[edge])) in highlightPairs or (int(destids[edge]), int(sourceids[edge])) in highlightPairs:
            color = "#FF0000"
        else:
            color = "#0000FF"
        folium.PolyLine(locations=edge_line, color=color, weight=2, tooltip=f"({sourceids[edge]}, {destids[edge]})").add_to(m)
    return m


